        {/* {detailIncomeVisible && (
          <>
            {finalIncomeObjectArray.map((i, index) => (
              <React.Fragment key={index}>
                <InputGroup className="mb-3">
                  <InputGroup.Text>항목&nbsp;&nbsp;</InputGroup.Text>
                  <Form.Control
                    type="text"
